import React, { useEffect, useState } from 'react';
import './index.css';
import { blackpices } from './pices/blackpices/exportblackpices.js';
import { whitepices } from './pices/whitepices/exportwhitepices.js';
import {isValidMove} from './script.js'

const App = () => {
  const [bishopwhite, kingwhite, queenwhite, rookwhite, pawnwhite, knightwhite] = whitepices;
  const [bishop, king, queen, rook, knight, pawn] = blackpices;
  const [Piece, setPiece] = useState('')
  const [Start, setStart] = useState('')
  const [End, setEnd] = useState('')
  useEffect(() => {
    const chessSquares = document.querySelectorAll('.chessSquare');
    const allPices = document.querySelectorAll('.pices');
    allPices.forEach(pice => {
      pice.addEventListener('dragstart', (e) => {
        pice.classList.add('dragable');
        setStart(pice.parentNode.id)
      });
      pice.addEventListener('dragend', () => {
        setEnd(pice.parentNode.id)
        setPiece(pice.id)
        pice.classList.remove('dragable');
      });
    });

    chessSquares.forEach(square => {
      square.addEventListener('dragover', (e) => {
        e.preventDefault();
        const draggingElement = document.querySelector('.dragable');
        if (draggingElement) {
          square.appendChild(draggingElement);
        }
      });
    });


    return () => {
      allPices.forEach(pice => {
        pice.removeEventListener('dragstart', () => { });
        pice.removeEventListener('dragend', () => { });
      });

      chessSquares.forEach(square => {
        square.removeEventListener('dragover', () => { });
      });
    };
  }, [Piece, End, Start]);
  useEffect(() => {
    if (Start && End) {
      const position = {
        A: 1, B: 2, C: 3, D: 4, E: 5, F: 6, G: 7, H: 8
      };

      const parsePosition = (pos) => {
        const [col, row] = pos.split('');
        return [position[col], Number(row)];
      };

      const startpoint = parsePosition(Start);
      const endpoint = parsePosition(End);
      const result = isValidMove(startpoint, endpoint, `${Piece}`);
      console.log(result);
    }
  }, [Piece, Start, End]);
  return (
    <div>
      <div id="chessboard">
        <div className="chessSquare white" id="A0"><img id='r' src={rookwhite} alt="rook" className="rook pices" draggable="true" /></div>
        <div className="chessSquare black" id="B0"><img id='n' src={knightwhite} alt="knight" className="knight pices" draggable="true" /></div>
        <div className="chessSquare white" id="C0"><img id='b' src={bishopwhite} alt="bishop" className="bishop pices" draggable="true" /></div>
        <div className="chessSquare black" id="D0"><img id='k' src={kingwhite} alt="king" className="king pices" draggable="true" /></div>
        <div className="chessSquare white" id="E0"><img id='q' src={queenwhite} alt="queen" className="queen pices" draggable="true" /></div>
        <div className="chessSquare black" id="F0"><img id='b' src={bishopwhite} alt="bishop" className="bishop pices" draggable="true" /></div>
        <div className="chessSquare white" id="G0"><img id='n' src={knightwhite} alt="knight" className="knight pices" draggable="true" /></div>
        <div className="chessSquare black" id="H0"><img id='r' src={rookwhite} alt="rook" className="rook pices" draggable="true" /></div>
        <div className="chessSquare black" id="A1"><img id='p' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="B1"><img id='p' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="C1"><img id='p' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="D1"><img id='p' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="E1"><img id='p' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="F1"><img id='p' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="G1"><img id='p' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="H1"><img id='p' src={pawnwhite} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="A2"> </div>
        <div className="chessSquare black" id="B2"> </div>
        <div className="chessSquare white" id="C2"> </div>
        <div className="chessSquare black" id="D2"> </div>
        <div className="chessSquare white" id="E2"> </div>
        <div className="chessSquare black" id="F2"> </div>
        <div className="chessSquare white" id="G2"> </div>
        <div className="chessSquare black" id="H2"> </div>
        <div className="chessSquare black" id="A3"> </div>
        <div className="chessSquare white" id="B3"> </div>
        <div className="chessSquare black" id="C3"> </div>
