        <div className="chessSquare white" id="A4"> </div>
        <div className="chessSquare black" id="B4"> </div>
        <div className="chessSquare white" id="C4"> </div>
        <div className="chessSquare black" id="D4"> </div>
        <div className="chessSquare white" id="E4"> </div>
        <div className="chessSquare black" id="F4"> </div>
        <div className="chessSquare white" id="G4"> </div>
        <div className="chessSquare black" id="H4"> </div>
        <div className="chessSquare black" id="A5"> </div>
        <div className="chessSquare white" id="B5"> </div>
        <div className="chessSquare black" id="C5"> </div>
        <div className="chessSquare white" id="D5"> </div>
        <div className="chessSquare black" id="E5"> </div>
        <div className="chessSquare white" id="F5"> </div>
        <div className="chessSquare black" id="G5"> </div>
        <div className="chessSquare white" id="H5"> </div>
        <div className="chessSquare white" id="A6"><img id='P' src={pawn} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="B6"><img id='P' src={pawn} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="C6"><img id='P' src={pawn} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="D6"><img id='P' src={pawn} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="E6"><img id='P' src={pawn} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="F6"><img id='P' src={pawn} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare white" id="G6"><img id='P' src={pawn} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="H6"><img id='P' src={pawn} alt="pawn" className="pawn pices" draggable="true" /></div>
        <div className="chessSquare black" id="A8"><img id='R' src={rook} alt="rook" className="rook pices" draggable="true" /></div>
        <div className="chessSquare white" id="B8"><img id='N' src={knight} alt="knight" className="knight pices" draggable="true" /></div>
        <div className="chessSquare black" id="C8"><img id='B' src={bishop} alt="bishop" className="bishop pices" draggable="true" /></div>
        <div className="chessSquare white" id="D8"><img id='Q' src={queen} alt="queen" className="queen pices" draggable="true" /></div>
        <div className="chessSquare black" id="E8"><img id='K' src={king} alt="king" className="king pices" draggable="true" /></div>
        <div className="chessSquare white" id="F8"><img id='B' src={bishop} alt="bishop" className="bishop pices" draggable="true" /></div>
        <div className="chessSquare black" id="G8"><img id='N' src={knight} alt="knight" className="knight pices" draggable="true" /></div>
        <div className="chessSquare white" id="H8"><img id='R' src={rook} alt="rook" className="rook pices" draggable="true" /></div>
      </div>
    </div>
  );
};

export default App;
